import TaskCard from "./cards";

function Schedule() {
    const task = {
        name: "Finish Project",
        description: "Complete the final project report and submit it.",
        dueDate: "2024-10-05",
        timeStart: "10:00 AM",
        timeEnd: "12:00 PM",
    };


    return (
        <div className="schedule">
            <div className="create_div">
                <div className="tag">CREATE A TASK</div>
                <div className="add_div">
                    <button type="button">
                        <img src="/images/add.png" alt="Add" />
                    </button>
                </div>
            </div>
            <div className="list_div">
                <TaskCard task={task} />
            </div>
        </div>
    );
}

export default Schedule;
